CAPTURE_JS = function(args, callback) {
    var nodeName = args[0],
        node = args[1];

    if (nodeName == VAR(VAR_SCRIPT)) {
        callback(GET_ATTR(node, VAR_SRC), VAR_SRC);
    }
}